import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import Home from "./pages/Home";
import Detailproduit from "./components/Detailproduit";

function App() {
  return (
      <Router>
        <Switch>
          <Route path="/details" exact>
            <Detailproduit/>
          </Route>
          <Route path="/" exact>
            <Home />
          </Route>
        </Switch>
      </Router>
  );
}

export default App;
